import React from 'react';
import './Experience.css';

const Experience = () => {
  const experiences = [
    {
      title: "AI Research Intern",
      company: "Tech Research Lab",
      period: "Jan 2024 - Present",
      description: "Working on cutting-edge AI projects, implementing machine learning models, and conducting research in natural language processing.",
      skills: ["Python", "TensorFlow", "NLP", "Research"]
    },
    {
      title: "Machine Learning Developer",
      company: "AI Solutions Inc",
      period: "Jun 2023 - Dec 2023",
      description: "Developed and deployed machine learning models for real-world applications, focusing on computer vision and predictive analytics.",
      skills: ["PyTorch", "OpenCV", "Deep Learning", "Docker"]
    },
    {
      title: "Software Development Intern",
      company: "Tech Innovators",
      period: "Jan 2023 - May 2023",
      description: "Built and maintained web applications, implemented new features, and collaborated with cross-functional teams.",
      skills: ["React", "Node.js", "MongoDB", "Git"]
    }
  ];

  return (
    <section id="experience" className="experience-section">
      <div className="experience-container">
        <h2 className="experience-title">Experience</h2>
        <p className="experience-subtitle">
          My professional journey and contributions in the field of AI, ML, and software development.
        </p>

        <div className="experience-timeline">
          {experiences.map((exp, index) => (
            <div key={index} className="experience-card">
              <div className="experience-header">
                <h3 className="experience-role">{exp.title}</h3>
                <span className="experience-company">{exp.company}</span>
                <span className="experience-period">{exp.period}</span>
              </div>
              <p className="experience-description">{exp.description}</p>
              <div className="experience-skills">
                {exp.skills.map((skill, skillIndex) => (
                  <span key={skillIndex} className="skill-tag">{skill}</span>
                ))}
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Experience;
